/* lazyload inicializacia */
 var lazyLoadInstance = new LazyLoad({
    elements_selector: ".lazy",
    threshold: 0
});

/* post count */
function add_post_view_count(post_id){
    var miliseconds = 5000;                                                  
    var data = {
      action: 'add_post_count',
      post_id: post_id
    };
    setTimeout( function(){ jQuery.post('/wp-admin/admin-ajax.php', data) }, miliseconds);
}

function pageMove(clicked_page){

    $('.pagination .pages .page-number.active').removeClass('active');
    clicked_page.addClass('active');
    var page = parseInt(clicked_page.attr('page'));
    $('#page_num').val(page);
    scrollTo(   $('h1') );
    var pages_count = $('#pages_count').val();
    
    if(pages_count == page){
        $('.js-move-page-button[type="1"]').attr('disabled', 'disabled');
        $('.js-move-page-button[type="1"]').attr('page', page);
    }else{
        $('.js-move-page-button[type="1"]').removeAttr('disabled');
        $('.js-move-page-button[type="1"]').attr('page', (page+1));
    }
    
    if(page > 1){
        $('.js-move-page-button[type="0"]').attr('page', (page-1)).removeAttr('disabled');
    }else{
        $('.js-move-page-button[type="0"]').attr('page', page).attr('disabled', 'disabled');
    }
    return page;
}

function ajax_blog_page(page){
    
    var cat = $('#blog_cat').val();

    var data = {
        cat: cat,
        page: page,
        action: 'blog_page' 
    };
    
    getParameter = '?page_num='+page;
    
    jQuery.post('/wp-admin/admin-ajax.php', data, function(response) {

        if(response){
            $('#blog_loop').html(response);
            window.history.replaceState( {} , '', getParameter );
            lazyLoadInstance.update();
        }
    
    });

}             

/* notifikacia */
function add_filter_bubbles(name, id){
  var bubble = '<span class="filter-bubble" data="'+ id +'">'+ name +'</span>';
  $('.filter-bubbles').append(bubble);
}
function removeBubble(data){

  if(data == 'price_to'){
       $('.price-slider').val(  $('.price-slider').attr('max')    );
  }else{
       $('#'+data).prop('checked',false);
  }
  $('.filter-bubble[data="'+data+'"]').remove();     
  prepare_to_filter();
}

var prepareToFilterInverval;
function prepare_to_filter(){
    $('#page_num').val(1);
    clearInterval(prepareToFilterInverval);
    var milliseconds = 15;
    var elem = $('.filter_prepare_line'); 
    var width = 1;
    
    if($('#instant_filter').val()){
    
        ajax_filter_products();
    
    }else {
    
      prepareToFilterInverval = setInterval(function(){
      
          
      if (width >= 100) {
        clearInterval(prepareToFilterInverval);
        ajax_filter_products();
      } else {
        width++; 
        elem.css('width', width + '%'); 
      }
          
      }, milliseconds);
    
    }
  
}

function ajax_filter_products(){
    
    var getParameters = '?f=1';
    var page = $('#page_num').val();
    $('.filter-bubbles').html('');
    var instock = 0;
    var onsale = 0;
    var news = 0;
    var search = 0;
    
    if( search = $('#search_string').val()){
      getParameters += '&s='+search;
    }
    
    if (  $('#filter_news').is(':checked')  ) {
        news = 1;
        add_filter_bubbles($('#filter_news').attr('name'), 'filter_news');
        getParameters += '&news=1';
    }
    
    if (  $('#filter_onsale').is(':checked')  ) {
        onsale = 1;
        add_filter_bubbles($('#filter_onsale').attr('name'), 'filter_onsale');
        getParameters += '&onsale=1';
    }
    
    if (  $('#filter_instock').is(':checked') ) {
        var instock = 1;
        add_filter_bubbles($('#filter_instock').attr('name'), 'filter_instock');
        getParameters += '&instock=1';
    }
    var data_to_send = {
        action: 'product_filter',
        page_num: page,
        search: search,
        onsale: onsale,
        news: news,
        instock: instock,
        current_category_id: $('#current_category_id').val(),
        filter: []
    };
    
    
    var previous_type = '';
    var price_slider = $('.price-slider');
    var price_to = price_slider.val();
    var price_max = price_slider.attr('max');
    var order_by = $('.orderby').val();
    ids = [];
        
    if(parseInt(price_to) < parseInt(price_max)){
        getParameters += '&price_to='+price_to;
        data_to_send['price_to'] = price_to;
        add_filter_bubbles( price_slider.attr('name') + ': '+price_to, 'price_to');
    }
    if(order_by != 'name'){
        getParameters += '&orderby='+order_by;
        data_to_send['orderby'] = order_by;
    }
    
    var checkboxs = $('input.filter-checkbox:checked');
    var checkboxs_length = checkboxs.length;
    
    if(checkboxs_length){
      checkboxs.each(function(index, element) {
        
         type = $(this).attr('term_type');
         name = $(this).attr('term_name'); 
         id = $(this).attr('term_id');
         add_filter_bubbles(name, type+'-'+id);
         
         if(type == previous_type || previous_type == ''){
         
           ids.push(id);
         
         }else{
            
            var obj = {};
            obj[previous_type] = ids;
            
            data_to_send.filter.push(obj);
            ids = [];
            ids.push(id);
          
         }
         
         previous_type = type; 
         
         getParameters  += '&'+type+'[]'+'='+id;
          
      });
      
      var obj = {};
      obj[type] = ids;
      
      data_to_send.filter.push(obj);  
    
    } 
    if(page > 1){
        getParameters += '&page_num='+page;
    }    
    
    window.history.replaceState( {} , '', getParameters ); 
    
      jQuery.post('/wp-admin/admin-ajax.php', data_to_send, function(response) {
      
           if(response){
              $('#products_loop').html(response);
              $('.filter_prepare_line').css('width', 0);
               //lazyLoadInstance.update();
           }
      
      })  

}

function notif( notif_type, text){

  if(text){
    var content = text;
  }else if(notif_type == 'success'){
    var content = $('#item_added_to_cart_text').val();
  }
    
  id = Math.random().toString(36).substring(7);
                        
  
  
  $('#notif_wrapper').append('<div id="'+ id +'" class="notif '+ notif_type +'">'+ content +'</div>');
  
  if( $('.notif').length > 3 ){
    $('.notif').first().remove();
  }
    
  $('#'+id).delay( 4000 ).fadeOut('slow', function(){
     $(this).remove();
  })
}

/* create cookie gdpr */
function createCookie(name, value, days) {
  if (days) {
      var date = new Date();
      date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
      var expires = "; expires=" + date.toGMTString();
  }
  else var expires = "";               

   document.cookie = name + "=" + value + expires + "; path=/";
}

function readCookie(name) {
  var nameEQ = name + "=";
  var ca = document.cookie.split(';');
  for (var i = 0; i < ca.length; i++) {
      var c = ca[i];
      while (c.charAt(0) == ' ') c = c.substring(1, c.length);
      if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length, c.length);
  }
  return null;
}

function addToCart(form, button, product_url){
  
  var buttonText = button.html();
  button.html('<img class="loader" src="'+document.location.origin+'/wp-content/themes/goshop/images/loader.gif" alt="ajax loader">');
  $.post(product_url, form.serialize() + '&_wp_http_referer=' + product_url, function (result){
       
      var error = $('.woocommerce-notices-wrapper .alert.alert-danger', result);
      if(typeof error !== 'undefined'){
        //console.log(error);
         if(typeof error[0] !== 'undefined'){
          notif('danger', error[0].innerText);
          $('.single_add_to_cart_button').text(buttonText);
          return false;
        }
      }
      
      // update mobile mini cart count
      var mobile_mini_cart = $('.mobil-kosik-pocet-badge', result);
      $('.mobil-kosik-pocet-badge').replaceWith(mobile_mini_cart);
      
      // update mini cart
      var mini_cart = $('.basket_wrapper', result);
      $('.basket_wrapper').replaceWith(mini_cart);
      
      notif('success');
      
      if($(window).width() > 750){
        var cart = $('.basket_icon_wrapper');
        if(form.hasClass('additional-sale')){
           var imgtodrag = $('.additional-sale-image[data-product-id="'+ $('input[name="add-to-cart"]', form).val() +'"]').first();
           
        }else{ 
            var imgtodrag = $('.product-main-image').first();
        }
        
        if (imgtodrag.length) {
            var imgclone = imgtodrag.clone()
                .offset({
                top:  imgtodrag.offset().top,
                left: imgtodrag.offset().left
            })
              .css({
                'opacity': '0.5',
                'position': 'absolute',
                'height': '150px',
                'width': '150px',
                'z-index': '100'
            })
              .appendTo($('body'))
              .animate({
                'top': cart.offset().top + 10,
                'left': cart.offset().left + 10,
                'width': 75,
                'height': 75
            });
             
            imgclone.animate({
                'width': 0,
                'height': 0
            }, function (){
                $(this).detach()
            });
            
        }
      }
   
   button.html(buttonText); 
   button.attr('disabled', false); 
  });

}
 
