function toolTipPosition(elem){
    var html = elem.attr('data-tooltip');
    $('.goshop-tooltip .tooltip-inner').html(html);
    
    var offset = elem.offset();
    var top  = offset.top;
    var left = offset.left; 
    
    var elem_width = elem.width();
    
    var tooltip_height = $('.goshop-tooltip').height();
    var tooltip_width = $('.goshop-tooltip').width()/2;
    
    var top_offset = top - tooltip_height-5;
    var left_offset = left + (elem_width/2) - tooltip_width;
   
    $('.goshop-tooltip .tooltip-arrow').css('left', (tooltip_width-7));
    $('.goshop-tooltip').css({'top': top_offset, 'left': left_offset });
    $('.goshop-tooltip').show();
}
function toolTipHide(){
    $('.goshop-tooltip').removeClass('tooltip-fixed');
    $('.goshop-tooltip').hide();
}

